import React, { useEffect, useState } from 'react';
import { Container, Grid,  List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { Home, Inbox, Mail, LiveTv, ViewComfy, Timeline, MoreHoriz } from '@mui/icons-material';
import './App.css'; 


const App = () => {
  const pageStyles = {
    backgroundColor: '#111115',
    minHeight: '100vh',
    display: 'flex',
  };

  const sidebarStyles = {
    backgroundColor: '#151515',
    width: '8vw',
    padding: '16px',
    minHeight: '100vh',
    marginLeft: '-130px',
  };

  const listItemStyles = {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '12px',
  };

  const logoStyles = {
    display: 'flex',
    alignItems: 'center',
    marginBottom: '20px',
  };

  const secondSidebarStyles = {
    backgroundColor: '#0D0D0F',
    width: '15vw',
    padding: '16px',
    minHeight: '100vh',
    color: 'white',
  };


  const App = () => {
    const [isMobile, setIsMobile] = useState(false);

    useEffect(() => {
      // Check the screen width and update isMobile state
      const handleResize = () => {
        setIsMobile(window.innerWidth <= 768);
      };

      // Initial check
      handleResize();

      // Attach the resize event listener
      window.addEventListener('resize', handleResize);

      // Clean up the event listener
      return () => window.removeEventListener('resize', handleResize);
    }, []);
  };

  return (
    <div style={pageStyles}>
      <Container>
        <Grid container>
          <Grid className="sidebar">
            <div style={logoStyles}>
              <img src="/path-to-your-logo.png" alt="Logo" />
            </div>
            <List>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white' }}>
                  <Home />
                </ListItemIcon>
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white' }}>
                  <Inbox />
                </ListItemIcon>
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white' }}>
                  <Mail />
                </ListItemIcon>
              </ListItem>
            </List>
          </Grid>
          <Grid className={isMobile ? 'second-sidebar-responsive' : 'second-sidebar'}>
            <List>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white' }}>
                  <LiveTv />
                </ListItemIcon>
                <ListItemText primary="Live" />
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white' }}>
                  <ViewComfy />
                </ListItemIcon>
                <ListItemText primary="Layout" />
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white' }}>
                  <Timeline />
                </ListItemIcon>
                <ListItemText primary="Sequence" />
              </ListItem>
              <ListItem button sx={listItemStyles}>
                <ListItemIcon sx={{ color: 'white' }}>
                  <MoreHoriz />
                </ListItemIcon>
                <ListItemText primary="More" />
              </ListItem>
            </List>
          </Grid>
          <Grid item xs={6}>
            {/* Main content */}
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default App;
